import AssetActionTypes from './asset.types';

const INITIAL_STATE = {
    hidden: null,
    test: []
}

const AssetReducer = (state = INITIAL_STATE, action) => {
    switch(action.type){
        case AssetActionTypes.HELLO:
            return {
                hidden: 'Hello World',
                ...state
            };

        default:
            return state;
    }
}

export default AssetReducer;
